import React from 'react';

const MyImage = (props) => {
    const { image } = props;

    return (
        <div className="clip-filter" style={headerDivImg}>
            <img src={image} 
                height="125px" 
                className="clip-circle-at" />
        </div>       
    );
};

export default MyImage;


const headerDivImg = {
    textAlign: "center", 
    flex: "1",
    marginLeft: "1em", 
    padding: "0.5em"
}
